import styled from "styled-components";

export const Container = styled.main`
  width: 1200px;
  margin: 0 auto;
  padding: 2.5rem 1rem;
  display: grid;
  gap: 1.25rem;
  grid-template-columns: 1fr 1fr;
  justify-content: center;
  align-items: center;
`;
